import React, { useState, useEffect } from 'react';

const CertificateOfRegistration = ({ studentData, onClose }) => {
  const [currentSemester, setCurrentSemester] = useState('1st Semester 2024');
  const [courses, setCourses] = useState([]);
  const [isEditing, setIsEditing] = useState(false);

  // Sample course data - in real app, this would come from props or API
  useEffect(() => {
    const sampleCourses = [
      {
        code: 'GE 2',
        title: 'Understanding the self',
        units: 3,
        lec: 3,
        lab: 0,
        section: 'CCS 1G',
        day: 'W',
        time: '6:00 PM - 9:00 PM',
        instructor: 'VILLACARLOS'
      },
      {
        code: 'GE 1',
        title: 'Mathematics in the Modern World',
        units: 3,
        lec: 3,
        lab: 0,
        section: 'CCS 1G',
        day: 'M',
        time: '6:00 PM - 9:00 PM',
        instructor: 'KANMO'
      },
      {
        code: 'CC 101',
        title: 'IT Fundamentals',
        units: 3,
        lec: 3,
        lab: 0,
        section: 'CCS 1G',
        day: 'TH',
        time: '6:00 PM - 9:00 PM',
        instructor: 'TAVU ER'
      },
      {
        code: 'CC 102',
        title: 'Programming 1 (Intro to Java)',
        units: 3,
        lec: 2,
        lab: 3,
        section: 'CCS 1G',
        day: 'F',
        time: '4:00 PM - 9:00 PM',
        instructor: 'R-YAMSON'
      },
      {
        code: 'OP 1',
        title: 'Office Productivity 1 (MS Office)',
        units: 3,
        lec: 2,
        lab: 3,
        section: 'CCS 1G',
        day: 'T',
        time: '4:00 PM - 9:00 PM',
        instructor: 'G RAQUEL'
      }
    ];
    setCourses(sampleCourses);
  }, []);

  const calculateTotals = () => {
    const totalUnits = courses.reduce((sum, course) => sum + course.units, 0);
    const totalLec = courses.reduce((sum, course) => sum + course.lec, 0);
    const totalLab = courses.reduce((sum, course) => sum + course.lab, 0);
    return { totalUnits, totalLec, totalLab };
  };

  const handleEditCourse = (index, field, value) => {
    const updatedCourses = [...courses];
    updatedCourses[index][field] = value;
    setCourses(updatedCourses);
  };

  const handleAddCourse = () => {
    setCourses([
      ...courses,
      {
        code: '',
        title: '',
        units: 0,
        lec: 0,
        lab: 0,
        section: '',
        day: '',
        time: '',
        instructor: ''
      }
    ]);
  };

  const handleRemoveCourse = (index) => {
    const updatedCourses = courses.filter((_, i) => i !== index);
    setCourses(updatedCourses);
  };

  const handlePrint = () => {
    window.print();
  };

  const { totalUnits, totalLec, totalLab } = calculateTotals();

  // Fees breakdown
  const fees = {
    tuition: 6000,
    laboratory: 900,
    computer: 2700,
    misc: {
      title: 15,
      cultural: 15,
      ptcCup: 75,
      ssc: 75,
      guidance: 100,
      handbook: 50,
      library: 40,
      medical: 50,
      insurance: 50,
      registration: 75,
      id: 150
    }
  };

  const totalMiscFees = Object.values(fees.misc).reduce((sum, fee) => sum + fee, 0);
  const totalFees = fees.tuition + fees.laboratory + fees.computer + totalMiscFees;

  return React.createElement(
    'div',
    { className: 'cor-container' },
    // Control Panel
    React.createElement(
      'div',
      { className: 'cor-controls' },
      React.createElement(
        'button',
        {
          className: 'print-btn',
          onClick: handlePrint
        },
        'üñ®Ô∏è Print COR'
      ),
      React.createElement(
        'button',
        {
          className: 'edit-btn',
          onClick: () => setIsEditing(!isEditing)
        },
        isEditing ? 'üîí Lock Editing' : '‚úèÔ∏è Edit COR'
      ),
      React.createElement(
        'button',
        {
          className: 'close-btn',
          onClick: onClose
        },
        '‚ùå Close'
      )
    ),

    // Certificate of Registration Document
    React.createElement(
      'div',
      { className: 'cor-document' },
      // Header
      React.createElement(
        'div',
        { className: 'cor-header' },
        React.createElement(
          'div',
          { className: 'school-header' },
          React.createElement('h1', null, 'PATEROS TECHNOLOGICAL COLLEGE'),
          React.createElement('p', { className: 'school-address' }, 
            'College St., Sto. Rosario - Kanluran Pateros, Metro Manila'
          ),
          React.createElement('h2', { className: 'document-title' }, 
            'CERTIFICATE OF REGISTRATION'
          )
        )
      ),

      // Student Information
      React.createElement(
        'div',
        { className: 'student-info' },
        React.createElement(
          'div',
          { className: 'info-grid' },
          React.createElement(
            'div',
            { className: 'info-item' },
            React.createElement('strong', null, 'NAME: '),
            studentData ? 
              `${studentData.last_name}, ${studentData.first_name} ${studentData.middle_name || ''}`.toUpperCase() :
              'BAYLON, MARK CHRISTIAN MACASABUANG'
          ),
          React.createElement(
            'div',
            { className: 'info-item' },
            React.createElement('strong', null, 'ID NO: '),
            studentData?.student_number || '2022-8397'
          ),
          React.createElement(
            'div',
            { className: 'info-item' },
            React.createElement('strong', null, 'PROGRAM: '),
            studentData?.program_enrolled || 'CERTIFICATE IN COMPUTER SCIENCE'
          ),
          React.createElement(
            'div',
            { className: 'info-item' },
            React.createElement('strong', null, 'YEAR LEVEL: '),
            studentData?.year_level || '1ST YEAR'
          ),
          React.createElement(
            'div',
            { className: 'info-item full-width' },
            React.createElement('strong', null, 'ADDRESS: '),
            studentData?.address || '35 A BALLEGER ST ZONE 4, SOUTH SIGNAL'
          ),
          React.createElement(
            'div',
            { className: 'info-item' },
            React.createElement('strong', null, 'SEMESTER: '),
            isEditing ? 
              React.createElement('input', {
                type: 'text',
                value: currentSemester,
                onChange: (e) => setCurrentSemester(e.target.value),
                className: 'edit-input'
              }) :
              currentSemester
          )
        )
      ),

      // Courses Table
      React.createElement(
        'div',
        { className: 'courses-section' },
        React.createElement(
          'table',
          { className: 'courses-table' },
          React.createElement(
            'thead',
            null,
            React.createElement(
              'tr',
              null,
              React.createElement('th', null, 'COURSE CODE'),
              React.createElement('th', null, 'COURSE TITLE'),
              React.createElement('th', null, 'UNIT'),
              React.createElement('th', null, 'LEC'),
              React.createElement('th', null, 'LAB'),
              React.createElement('th', null, 'SECTION'),
              React.createElement('th', null, 'DAY'),
              React.createElement('th', null, 'TIME'),
              React.createElement('th', null, 'INSTRUCTOR'),
              isEditing && React.createElement('th', null, 'ACTION')
            )
          ),
          React.createElement(
            'tbody',
            null,
            courses.map((course, index) => 
              React.createElement(
                'tr',
                { key: index },
                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'text',
                      value: course.code,
                      onChange: (e) => handleEditCourse(index, 'code', e.target.value),
                      className: 'edit-input small'
                    }) :
                    course.code
                ),
                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'text',
                      value: course.title,
                      onChange: (e) => handleEditCourse(index, 'title', e.target.value),
                      className: 'edit-input'
                    }) :
                    course.title
                ),
                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'number',
                      value: course.units,
                      onChange: (e) => handleEditCourse(index, 'units', parseInt(e.target.value) || 0),
                      className: 'edit-input small'
                    }) :
                    course.units
                ),
                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'number',
                      value: course.lec,
                      onChange: (e) => handleEditCourse(index, 'lec', parseInt(e.target.value) || 0),
                      className: 'edit-input small'
                    }) :
                    course.lec
                ),
                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'number',
                      value: course.lab,
                      onChange: (e) => handleEditCourse(index, 'lab', parseInt(e.target.value) || 0),
                      className: 'edit-input small'
                    }) :
                    course.lab
                ),
                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'text',
                      value: course.section,
                      onChange: (e) => handleEditCourse(index, 'section', e.target.value),
                      className: 'edit-input small'
                    }) :
                    course.section
                ),
                React.createElement(
                  'td',
                  null,
                  isEditing ?
                    React.createElement('input', {
                      type: 'text',
                      value: course.day,
                      onChange: (e) => handleEditCourse(index, 'day', e.target.value),
                      className: 'edit-input small'
                    }) :
                    course.day
                ),
